import styled from "@emotion/styled";
import { Box } from "@mui/system";

export const AditionalSetingsWrapper = styled(Box)(() => ({
  display: "flex",
  alignItems: "center",
  jaustifyContent: "flex-start",
  paddingTop: "16px",
  paddingBottom: "16px",
}));
